import _ from 'lodash'
import { FETCH_POSTS, GET_POSTS } from '../actions/notes'

export default function (state = {}, action) {
  switch (action.type) {
    case FETCH_POSTS:
      const over = action.payload.data
      over.results = _.mapKeys(over.results, 'pk')
      state = over
      const a = Object.assign(over, state)
      console.log(a)
      return (a)
    default:
      return state
  }
}
